import React from "react";
import './Contenido_Archivos.css'

class Contenido_Archivos extends React.Component {
  render() {
    return (
        <body>
          <div id='divruta'>
          <div id='divrutas'>
            <img id="iconos" src='/img/icono_inicio.png' alt='' />
            <text id='textrutas'>Inicio</text>
            <img id="iconos" src='/img/icono_ayuda.png' alt='' />
            <text id='textrutas'>Ayuda/</text>
            <text id='textrutas'>Sistema</text>
          </div>
        </div>
        
        </body>
    )
  }
}
export default Contenido_Archivos;
